import React from 'react';
import { Card, CardContent, Typography, Box, Button, Chip } from '@mui/material';
import ArrowBackIcon from '@mui/icons-material/ArrowBack';

function RagAnalysisPage({ ragAnalysis, onBack }) {
  if (!ragAnalysis) {
    return (
      <Box sx={{ p: 4 }}>
        <Typography variant="h5">No RAG analysis data available.</Typography>
        <Button variant="contained" color="primary" onClick={onBack} sx={{ mt: 2 }}>
          <ArrowBackIcon sx={{ mr: 1 }} /> Back
        </Button>
      </Box>
    );
  }

  const { retrieved_docs } = ragAnalysis;

  // Helper: get icon and color for frame type
  const getFrameIcon = (category) => {
    if (!category) return null;
    const cat = String(category).replace('_', ' ').toLowerCase();
    if ([
      'safe content',
      'educational content',
      'entertainment content',
      'news content',
      'tutorials & how-to',
      'community & family-friendly',
      'artistic & creative expression',
      'positive social impact'
    ].includes(cat)) {
      return <span style={{ color: '#43a047', fontWeight: 'bold', fontSize: 22 }}>✔️</span>;
    }
    return <span style={{ color: '#e53935', fontWeight: 'bold', fontSize: 22 }}>⚠️</span>;
  };

  // Group violations by type for summary
  const violationTypes = {};
  if (retrieved_docs && retrieved_docs.length > 0) {
    retrieved_docs.forEach(doc => {
      const cat = doc.category || 'Violation';
      if (!violationTypes[cat]) violationTypes[cat] = { count: 0, frames: [], actions: new Set(), reasons: new Set() };
      violationTypes[cat].count++;
      violationTypes[cat].frames.push(doc);
      if (doc.action_required) violationTypes[cat].actions.add(doc.action_required);
      if (doc.policy && doc.policy.description) violationTypes[cat].reasons.add(doc.policy.description);
      if (doc.reasoning) violationTypes[cat].reasons.add(doc.reasoning);
    });
  }
  const totalFrames = retrieved_docs ? retrieved_docs.length : 0;
  const safeFrames = retrieved_docs ? retrieved_docs.filter(doc => String(doc.category).toLowerCase().includes('safe')).length : 0;
  const violationFrames = totalFrames - safeFrames;
  const complianceRate = totalFrames > 0 ? Math.round((safeFrames / totalFrames) * 100) : 0;

  // Build grouped summary lines
  let guidelineSummary = '';
  let guidelineReasons = [];
  if (complianceRate > 50) {
    guidelineSummary = 'This video follows YouTube guidelines.';
    guidelineReasons = ['No violations detected. Content is safe and suitable for YouTube.'];
  } else {
    guidelineSummary = 'This video does NOT follow YouTube guidelines.';
    Object.entries(violationTypes).forEach(([cat, info]) => {
      const mainReason = Array.from(info.reasons).join(' ');
      const actions = Array.from(info.actions).join(', ');
      guidelineReasons.push(
        `${cat}: Detected in ${info.count} frame${info.count > 1 ? 's' : ''}. ${mainReason}${actions ? ' Action Required: ' + actions + '.' : ''}`
      );
    });
    if (guidelineReasons.length === 0) {
      guidelineReasons = ['Violations detected, but no detailed policy explanation available.'];
    }
  }

  return (
    <Box sx={{ p: 5, background: 'linear-gradient(120deg, #e3f2fd 60%, #fffde7 100%)', minHeight: '100vh' }}>
      <Box sx={{ display: 'flex', alignItems: 'center', mb: 3 }}>
        <Button variant="outlined" color="secondary" sx={{ mr: 2, fontWeight: 'bold', borderRadius: 3 }} onClick={onBack}>
          ← Back
        </Button>
        <Typography variant="h4" color="primary" sx={{ fontWeight: 'bold' }}>
          RAG Policy Violation Explanations
        </Typography>
      </Box>
      {/* YouTube-style guideline summary */}
      <Card sx={{ maxWidth: 900, mb: 3, boxShadow: 3, borderRadius: 3, p: 2, background: complianceRate > 50 ? '#e8f5e9' : '#ffebee', border: complianceRate > 50 ? undefined : '2px solid #e53935' }}>
        <CardContent>
          <Typography variant="h6" sx={{ fontWeight: 'bold', color: complianceRate > 50 ? '#43a047' : '#e53935', mb: 1 }}>
            {guidelineSummary}
          </Typography>
          {guidelineReasons.map((reason, idx) => (
            <Typography key={idx} variant="body2" sx={{ mb: 0.5, color: complianceRate > 50 ? '#43a047' : '#e53935', fontWeight: complianceRate > 50 ? 'bold' : 'bold' }}>{reason}</Typography>
          ))}
          <Box sx={{ display: 'flex', gap: 2, mt: 2 }}>
            <Chip label={`Compliance Rate: ${complianceRate}%`} color={complianceRate > 50 ? 'success' : 'error'} sx={{ fontWeight: 'bold' }} />
            <Chip label={`Safe Frames: ${safeFrames}`} color="success" sx={{ fontWeight: 'bold' }} />
            <Chip label={`Violations: ${violationFrames}`} color="error" sx={{ fontWeight: 'bold' }} />
            <Chip label={`Total Frames: ${totalFrames}`} color="primary" sx={{ fontWeight: 'bold' }} />
          </Box>
        </CardContent>
      </Card>
      {/* Frame-by-frame cards */}
      <Box sx={{ display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(420px, 1fr))', gap: 3 }}>
        {retrieved_docs && retrieved_docs.length > 0 ? (
          retrieved_docs.map((doc, idx) => (
            <Card key={idx} sx={{ background: String(doc.category).toLowerCase().includes('safe') ? '#f9fbe7' : '#ffebee', borderRadius: 3, boxShadow: 2 }}>
              <CardContent>
                <Box sx={{ display: 'flex', alignItems: 'center', mb: 1 }}>
                  {getFrameIcon(doc.category)}
                  <Typography variant="subtitle1" sx={{ fontWeight: 'bold', ml: 1, color: String(doc.category).toLowerCase().includes('safe') ? 'success.main' : 'error.main' }}>
                    {doc.title || doc.category || 'Frame'}
                  </Typography>
                </Box>
                {doc.frame !== undefined && (
                  <Typography variant="body2" sx={{ mb: 0.5 }}>
                    <b>Frame #:</b> {doc.frame}
                  </Typography>
                )}
                {doc.timestamp !== undefined && (
                  <Typography variant="body2" sx={{ mb: 0.5 }}>
                    <b>Timestamp:</b> {doc.timestamp}s
                  </Typography>
                )}
                <Box sx={{ display: 'flex', gap: 1, flexWrap: 'wrap', mb: 1 }}>
                  {doc.category && (
                    <Chip label={`Category: ${doc.category}`} color={String(doc.category).toLowerCase().includes('safe') ? 'success' : 'primary'} />
                  )}
                  {doc.confidence !== undefined && (
                    <Chip label={`Confidence: ${doc.confidence}`} color="success" />
                  )}
                </Box>
                {doc.reasoning && <Typography variant="body2" sx={{ mb: 0.5 }}><b>Reasoning:</b> {doc.reasoning}</Typography>}
                {doc.blip && <Typography variant="body2" sx={{ mb: 0.5 }}><b>BLIP:</b> {doc.blip}</Typography>}
                {doc.ocr && <Typography variant="body2" sx={{ mb: 0.5 }}><b>OCR:</b> {doc.ocr}</Typography>}
                {doc.policy && <Typography variant="body2" sx={{ mb: 0.5 }}><b>Policy:</b> {doc.policy.description}</Typography>}
                {doc.examples && doc.examples.length > 0 && <Typography variant="body2" sx={{ mb: 0.5 }}><b>Examples:</b> {doc.examples.join(', ')}</Typography>}
                {doc.action_required && <Typography variant="body2" sx={{ mb: 0.5 }}><b>Action Required:</b> {doc.action_required}</Typography>}
                {doc.severity_indicators && doc.severity_indicators.length > 0 && <Typography variant="body2" sx={{ mb: 0.5 }}><b>Severity Indicators:</b> {doc.severity_indicators.join(', ')}</Typography>}
                {doc.context_factors && doc.context_factors.length > 0 && <Typography variant="body2" sx={{ mb: 0.5 }}><b>Context Factors:</b> {doc.context_factors.join(', ')}</Typography>}
                {doc.transcript && <Typography variant="body2" sx={{ mb: 0.5 }}><b>Transcript Excerpt:</b> {doc.transcript}</Typography>}
                {doc.keywords && doc.keywords.length > 0 && <Typography variant="body2" sx={{ mb: 0.5 }}><b>Keywords:</b> {doc.keywords.join(', ')}</Typography>}
              </CardContent>
            </Card>
          ))
        ) : (
          <Typography>No RAG explanations found.</Typography>
        )}
      </Box>
    </Box>
  );
}

export default RagAnalysisPage;
